import TopNav from './TopNav';
import Vodafone from './Vodafone';

// const images = ['image1', 'image2', 'image3', 'image4', 'image5'];

function App() {
	return (
		<div className='app'>
			<Carousel>
				<div>
					<h2>JPMorgan</h2>
				</div>
				<div>
					<h2>USAAâ“‡</h2>
